INSERT OR IGNORE INTO disease_interactions (id, med_id, trade_name, disease_name, interaction_text, severity, reference_text, source, created_at) VALUES (20301, 25545, 'Quetiapine', 'Neuroleptic Malignant Syndrome', 'The central dopaminergic blocking effects of neuroleptic agents may precipitate or aggravate a potentially fatal symptom complex known as neuroleptic malignant syndrome (NMS).  NMS is observed most frequently when high-potency agents like haloperidol are administered intramuscularly, but may occur with any neuroleptic agent given for any length of time.  Clinical manifestations of NMS include hyperpyrexia, muscle rigidity, altered mental status and autonomic instability (irregular pulse or blood pressure, tachycardia, diaphoresis and cardiac arrhythmias).  Additional signs may include elevated creatine phosphokinase, myoglobinuria, and acute renal failure.  Neuroleptic agents should not be given to patients with active NMS and should be immediately discontinued if currently being administered in such patients.  In patients with a history of NMS, introduction or reintroduction of neuroleptic agents should be carefully considered, since NMS may recur.', '3', '', 'DDInter', 0);
